-- данные для таблицы users_channels
WITH 
	user_id AS (
		SELECT id
		FROM users
		WHERE login = 'mike111'
	),
	channel_type_id AS (
		SELECT id
		FROM channels_types
		WHERE name = 'Telegram'
	)
VALUES (
			(SELECT id FROM user_id),
			(SELECT id FROM channel_type_id),
			'@White_AK111', 
			false
		);
		
